import React, {Suspense, useEffect, useState} from "react";
import {NavLink} from "react-router-dom";
import {Route, useRouteMatch} from "react-router";
import PatientBio from "./Patient Information/PatientBio";
import PatientForm from "./Patient Forms/PatientForm";
import FindPatient from "./Patient Forms/FindPatient";
import {patientURLS} from "../../../Constants/URLConstants";
import PatientListTable from "./Patient Forms/PatientListTable";


const PatientRouter = (props) => {
    const match=useRouteMatch();
    // const [component, setComponent] = useState(null);
    //
    // const LoadComponent = location => {
    //     const Component = React.lazy(() => import(`./Patient Forms/${location}`));
    //     setComponent(<Component />);
    // };

    useEffect(() => {
        // to load component from props
        // props.name === undefined ?
        //     LoadComponent("PatientForm") :
        //     LoadComponent(props.name)

    },[props.name])

    return (

        <div className="person-wrapper">
            <div className="person-component-buttons">
                <NavLink className="person" to={`${match.url}/${patientURLS.patientForm}`} >Create Patient</NavLink>
                <NavLink className="person" to={`${match.url}/${patientURLS.findPatients}`} >Find Patient</NavLink>
                <NavLink className="person" to={`${match.url}/${patientURLS.patientList}`} >Patients List</NavLink>
            </div>

            <div className="person-components">
                <Suspense fallback={<div>Loading...</div>}>
                <Route exact path={`${match.url}/${patientURLS.patientForm}`} component={PatientForm}/>
                <Route exact path={`${match.url}/${patientURLS.findPatients}`} component={FindPatient}/>
                <Route exact path={`${match.url}/${patientURLS.patientList}`} component={PatientListTable}/>
                    <Route exact path={`${patientURLS.patientInfo}:id`} component={PatientInformationWrapper}/>

                </Suspense>
            </div>


        </div>


    )

}

export default PatientRouter;
